import './App.css';
import TreeImage from './img/illustrations/undraw_Tree_swing_646s.svg';



function IntroSlide() {
  return (

	<div class="row">

		  <div class="col">
			  <h1 className="text-dark"><br /> Do Better In Tech</h1>
			  <br></br>
			  <br></br>
			  <br></br>
			  <br></br>
			  <br></br>
			  <br></br>
			  <h2 className="text-dark">Welcome to Impactful.</h2> 
		  </div>
	  <div class="col">
		  <img
			  class="img-fluid"
				  src={TreeImage}
			  alt="For Companies"
		  />
		  </div>
		  </div>  

  )
}

export default IntroSlide;
